import BaseLayout from "../components/layouts/BaseLayout";
import { NextPage } from "next";


const Portfolio: NextPage<{ data: any }> = () => {
    return (
        <BaseLayout>
            <h1>Portfolio Page</h1>
        </BaseLayout>
    )
}

Portfolio.getInitialProps = () => {

    return { data: "" }
}

export default Portfolio;
